  {
    path:"/",
    element:<Home/>,
  },
  {
    path:"/products/:id",
    element:<Products/>,
  },
  {
    path:"/product/:id",
    element:<Product/>
  },
])
function App() {
  return (
    <div className="App">
 <RouterProvider router={router}/>
    </div>
  );
}

